import {useNavigate} from 'react-router-dom';

const VocabContainer = (props) =>{
    console.log(props)
    console.log(props.vocabs)
    const navigate = useNavigate()
    return(
        <>
        <h1>Vocab list</h1>
        <table>
        <tbody>
          <tr>
            <th>Category Name</th>
            <th>Level 1</th>
            <th>Level 2</th>
            <th>Level 3</th>
          </tr>
            { props.vocabs.map((dog, i) => {
                return (
                  <tr key={dog.id}>
                    <td style={{textDecoration: "underline", color: "blue"}} onClick={()=>{navigate(`${dog.id}`)}}>
                    { dog.name }
                    </td>
                    <td>
                     { dog.breed }
                    </td>
                    <td>
                     { dog.owner }
                    </td>
                  </tr>
                )
              })
            }
          </tbody>
        </table>
        </>
    )
}
export default VocabContainer
